import com.google.common.collect.HashMultiset;
import com.google.common.collect.Multiset;
import com.google.common.collect.LinkedHashMultiset;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        Multiset<String> multiset = HashMultiset.create();
        Multiset<String> anotherMultiset = LinkedHashMultiset.create();
        Map<String, Integer> fruitMap = new HashMap<>();

        // Adding initial elements to anotherMultiset
        anotherMultiset.add("banana");
        anotherMultiset.add("banana");
        anotherMultiset.add("orange");

        // Adding elements to the fruitMap
        fruitMap.put("apple", 3);
        fruitMap.put("banana", 2);
        fruitMap.put("cherry", 5);

        // Iterating over the fruitMap to add elements to multiset
        for (Map.Entry<String, Integer> entry : fruitMap.entrySet()) {
            for (int i = 0; i < entry.getValue(); i++) {
                multiset.add(entry.getKey());
            }
        }

        /* write */ multiset.add("apple");

        // Performing operations on anotherMultiset
        anotherMultiset.add("apple");
        anotherMultiset.remove("banana");
        System.out.println("Count of banana in anotherMultiset: " + anotherMultiset.count("banana"));

        // Some unrelated computations
        int sum = 0;
        for (int i = 0; i < 10; i++) {
            sum += i;
        }
        System.out.println("Sum of numbers from 0 to 9: " + sum);

        // More operations on fruitMap
        fruitMap.put("orange", 4);
        fruitMap.remove("cherry");

        // Final operation and reading from multiset
        int appleCount = fruitMap.getOrDefault("apple", 0);
        System.out.println("Apple count in fruitMap: " + appleCount);

        /* read */ int count = multiset.count("apple");
        System.out.println("Count of apple in multiset: " + count);

        // Iterating over multiset to print all elements
        for (String fruit : multiset.elementSet()) {
            System.out.println(fruit + ": " + multiset.count(fruit));
        }
    }
}
